import React from 'react';
import firebase from '../utils/firebase';
import 'firebase/compat/firestore'

export default function Topics(){
    React.useEffect(()=>{
        firebase
        .firestore()
        .collection("topics")
        .get()
        .then((collectionSnapshot)=>{
            collectionSnapshot.docs.map(doc=>{
                return doc.data();
            })
        })
    })
    return (
        "Topics"
    )
}
